    "2013-03-15T22:19:19.265742",nt"name": "quaternary-faults-in-nevada-online-interactive-map",nt"isopen":
    false,nt"url": null,nt"notes": "This report is an online version of Nevada
    Bureau of Mines and Geology (NBMG) Map 167, Quaternary Faults in Nevada, published
    in 2008. Map 167 is available on the NBMG website Publication Sales page or the
    direct publication page, and is an updated depiction of data from the U.S. Geological
    Surveyu2019s Quaternary Fault and Fold Database for the United States (available
    at: http://earthquake.usgs.gov/regional/qfaults). Updates came primarily from geological
    maps published by the Nevada Bureau of Mines and Geology and numerous geotechnical
    consulting reports. Mapped faults are shown as solid lines on Map 167, whereas faults
    that are inferred are shown as dashed lines. However, many Quaternary faults remain
    undetected and unmapped, especially in alluvial valleys where they are covered by
    young sediments, in the mountains where a lack of young sediments makes determination
    of a Quaternary age difficult, deep in the Earth where detection relies on seismology
    and other remote sensing techniques, and in areas that have not yet been studied.",nt"license_title":
